import React from 'react'
import {bankOne} from './banks'

function Pads() {
    return (
        <div>
            {bankOne.map(pad => (
                <p className='drum-pad'>
                  {pad.keyTrigger}
                  <audio src={pad.url} id={pad.keyTrigger} className='clip' onClick={playSound}/>
                  </p>
              ))}
        </div>
    )
}

export default Pads
